<template>
	<!--pages/step/agreement/agreement.wxml-->
	<view class="page">
		<view class="fixed-top"><debt-step id="debtStep" currentSteps="2"></debt-step></view>
		<view class="page-content">
			<view class="invite-info">
				<view class="invite-step">
					<view class="invite-text">邀请{{ bond_num }}位好友下单助力即可获得资格</view>
					<view class="invite-tips">自己下单也可以给自己助力哦！</view>
					<view class="invite-user">
						<image v-for="(item, index) in inviteUser" :key="index" class="invite-user-item" :src="item.head_pic" mode="aspectFill"></image>
						<image v-for="(item, index) in bond_num - inviteUser.length" :key="index" class="invite-user-item" src="/static/empty_avatar.png" mode="widthFix"></image>
					</view>
				</view>
			</view>

			<view class="goods-section">
				<view class="title">
					<image class="img" mode="widthFix" src="/static/star_line_left.png"></image>
					<text class="text">超值宝贝</text>
					<image class="img" mode="widthFix" src="/static/star_line_right.png"></image>
					<view class="more-btn" @click="goMall">
						<text>更多</text>
						<image src="/static/icon_arrow_right.png"></image>
					</view>
				</view>
				<image class="product-meta" mode="widthFix" src="/static/product_meta_text.png"></image>
				<view class="goods-content">
					<view v-for="(item, index) in goodsList" :key="index" class="goods-item">
						<view @click="goProductDetail" :data-info="item">
							<image :src="item.original_img" mode="aspectFit" class="goods-img"></image>
							<view class="goods-name">{{ item.goods_name }}</view>
						</view>
						<view class="goods-info">
							<view class="goods-price">{{ item.shop_price }}</view>
							<view class="goods-sale">已售{{ item.sales_sum }}件</view>
							<!-- #ifdef MP-WEIXIN -->
							<button class="goods-share" open-type="share" :data-goods="item">分享</button>
							<!-- #endif -->
							<!-- #ifdef H5 -->
							<button class="goods-share" @click="h5Share(item)">分享</button>
							<!-- #endif -->
						</view>
					</view>
				</view>
				<view class="loading-finished" v-if="finished">没有更多内容了</view>
			</view>
		</view>
		<auth-login class="auth-login" id="auth-login" v-if="!isLoginShow" @myevent="onMyEvent"></auth-login>
		<cu-service></cu-service>
		<view class="bg_poster" v-if="showShareImg">
			<view class="poster">
				<view class="img"><image :src="posterUrl" mode=""></image></view>
				<view class="icon" @click.stop="shareClose">
					<view>长按图片后可保存到相册</view>
					<image src="../../../static/share_close.png" mode=""></image>
				</view>
			</view>
		</view>
	</view>
</template>

<script>
import { getGoodsList, getShareList, checkH5Auth, authUpdate } from '../../../utils/request/api';
import { baseUrl } from '../../../utils/request/request.js';
const globalData = getApp().globalData; // pages/step/mall/mall.js
import debtStep from '../../../components/debtStep/debtStep';
import { authMixins } from '../../../mixins/authMixins.js';
import util from '../../../utils/util.js';
export default {
	data() {
		return {
			keyword: getApp().globalData.keyword,
			isLoginShow: true,
			inviteUser: [],
			goodsList: [],
			pageSize: 10,
			pageNum: 1,
			totalPage: 1,
			bond_num: 0,
			posterUrl: '',
			showShareImg: false,
			finished: false
		};
	},
	mixins: [authMixins],
	components: {
		debtStep
	},
	onLoad(options) {
		// #ifdef H5
		if (options.code) {
			//核身结果->跟新核身状态->查询分享状态->获取商品列表
			this.accountAuth(
				options.code,
				() => {
					if (options.BizToken) {
						this.checkH5Auth(options.BizToken);
					}
				},
				err => {
					this.isLoginShow = false;
				}
			);
		} else {
			if (!!uni.getStorageSync('uid') && !!uni.getStorageSync('token')) {
				if (options.BizToken) {
					this.checkH5Auth(options.BizToken);
				} else {
					this.getShareList();
				}
			} else {
				this.setData({
					isLoginShow: false
				});
			}
		}
		// #endif
		// #ifdef MP-WEIXIN
		if (options.BizToken) {
			this.checkH5Auth(options.BizToken);
		}
		// #endif
	},
	onShow: function(options) {
		// #ifdef MP-WEIXIN
		if (!!uni.getStorageSync('uid') && !!uni.getStorageSync('token')) {
			this.getShareList();
		} else {
			this.setData({
				isLoginShow: false
			});
		}
		// #endif
		this.setData({
			keyword: uni.getStorageSync('keyword')
		});
	},

	onPullDownRefresh: function() {
		// uni.showNavigationBarLoading();
		// uni.hideNavigationBarLoading();
		// uni.stopPullDownRefresh();
		this.pageNum = 1;
		this.goodsList = [];
		this.finished = false;
		this.getShareList();
	},

	onReachBottom: function() {
		if (!this.finished) {
			this.getGoodsList(++this.pageNum);
		}
	},

	onShareAppMessage: function(options) {
		var that = this; // 设置转发内容

		var shareObj = {
			title: this.keyword + '人服务',
			path: '/pages/creditorDetail/creditorDetail'
		}; // 来自页面内的按钮的转发

		if (options.from == 'button') {
			var shareInfo = options.target.dataset.goods; //上方data-id=shareBtn设置的值
			// 此处可以修改 shareObj 中的内容

			shareObj.path = `/pages/startMiddler/startMiddler?goods_id= ${shareInfo.goods_id}&first_leader=${shareInfo.first_leader}`;
			shareObj.title = shareInfo.goods_name;
			shareObj.imageUrl = shareInfo.original_img;
		}

		return shareObj;
	},
	methods: {
		goMall() {
			// #ifdef MP-WEIXIN
			uni.navigateToMiniProgram({
				appId: 'wx1c16e109ac7ddad9',
				path: '/pages/index/index/index',
				extraData: {},
				envVersion: globalData.envVersion,

				success(res) {
					// 打开成功
					console.log(res);
				}
			});
			// #endif
			// #ifdef H5
			uni.navigateTo({
				url: '../../mallShareMiddle/mallShareMiddle'
			});
			// #endif
		},
		h5Share(e) {
			this.showShareImg = true;
			this.getH5ShareImg(e);
		},
		shareClose() {
			this.showShareImg = false;
			this.posterUrl = '';
		},
		getH5ShareImg(goods) {
			let _this = this;
			uni.showLoading({
				title: '正在生成',
				mask: true
			});
			uni.getImageInfo({
				src: `https://mall.yolaile.com/api/goods/goodsSharePoster?id=${goods.goods_id}&item_id=0&prom_id=0&store_id=${goods.store_id}&prom_type=0&leader_id=${goods.first_leader}`,
				success: function(res) {
					_this.posterUrl = res.path;
				},
				complete: function(res) {
					uni.hideLoading();
				}
			});
		},
		goProductDetail(e) {
			// #ifdef MP-WEIXIN
			let options = e.currentTarget.dataset.info;
			uni.navigateToMiniProgram({
				appId: 'wx1c16e109ac7ddad9',
				path: `pages/goods/goodsInfo/goodsInfo?goods_id=${options.goods_id}&item_id=&first_leader=${options.first_leader}`,
				extraData: {},
				envVersion: globalData.envVersion,

				success(res) {
					// 打开成功
					console.log(res);
				}
			});
			// #endif
		},

		getGoodsList() {
			getGoodsList({
				page: this.pageNum,
				page_size: this.pageSize
			}).then(res => {
				if (res.code == 200) {
					this.setData({
						goodsList: this.goodsList.concat(res.data)
					});
					uni.stopPullDownRefresh();
					if (res.data.length == 0) {
						this.finished = true;
					}
				} else if (res.code == 99) {
					this.setData({
						isLoginShow: false
					});
					uni.showToast({
						title: res.msg,
						icon: 'none',
						mask: true
					});
				} else {
					uni.showToast({
						title: res.msg,
						icon: 'none',
						mask: true
					});
				}
			});
		},
		authUpdate(idCard, name) {
			authUpdate({
				idCard,
				name
			}).then(res => {
				if (res.code == 200) {
					this.getShareList();
				} else if (res.code == 99) {
					this.setData({
						isLoginShow: false
					});
					uni.showToast({
						title: res.msg,
						icon: 'none',
						mask: true
					});
				} else {
					uni.showToast({
						title: res.msg,
						icon: 'none',
						mask: true
					});
				}
			});
		},
		getShareList() {
			getShareList().then(res => {
				if (res.code == 200) {
					this.goodsList = [];
					this.getGoodsList();

					// if (res.data.finish_status == 1) {
					// 	uni.redirectTo({
					// 		url: '/pages/creditorDetail/creditorDetail?new=1'
					// 	});
					// } else {
					this.inviteUser = res.data.list || [];
					this.bond_num = res.data.bond_num;
					// }
				} else if (res.code == 99) {
					this.setData({
						isLoginShow: false
					});
					uni.showToast({
						title: res.msg,
						icon: 'none',
						mask: true
					});
				} else {
					uni.showToast({
						title: res.msg,
						icon: 'none',
						mask: true
					});
				}
			});
		},
		checkH5Auth(bizToken) {
			checkH5Auth({
				bizToken: bizToken
			}).then(res => {
				if (res.code == 200) {
					this.authUpdate(res.data.IdCard, res.data.Name);
				} else if (res.code == 99) {
					this.isLoginShow = false;
					uni.showToast({
						title: res.msg,
						icon: 'none',
						mask: true
					});
				} else {
					uni.showToast({
						title: res.msg,
						icon: 'none',
						mask: true
					});
				}
			});
		},
		onMyEvent: function(e) {
			var that = this;
			that.setData(
				{
					isLoginShow: e.isLoginShow
				},
				function() {
					if (uni.getStorageSync('uid') && uni.getStorageSync('token')) {
						that.getShareList();
					}
				}
			);
		}
	}
};
</script>
